import axios from "axios";
import { getQAByID } from "./endpoints";
export const getQAById = (id: any) => {
  axios
    .get(`${getQAByID}?id=${id}`)
    .then(function (response) {
      // handle success
      console.log({ QA: response.data });
      return response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
};
